INSERT INTO `about_us` VALUES (1,'Amakuru Agezweho Mashyashya Akakanya','Murakaza neza kuri agezweho.com, urubuga rwu2025amakuru agezweho arimo amakuru agezweho mashyashya akakanya ndetse nu2025ibindi bigezweho mu buzima bwa buri munsi. Ku bwu2025isosiyete yacu Novarwa, dushyize imbere gutanga amakuru afatika, yizewe kandi yubaka umuryango.\n\n### Intego yacu\nGutanga amakuru yu2025ukuri kandi afasha buri wese gukurikirana ibigezweho, cyane cyane amakuru agezweho mashyashya akakanya hamwe nu2025izindi nkuru zifite akamaro ku buzima bwa buri munsi.\n\n### Abo turi bo\nNovarwa ni isosiyete yu2025ubunyamwuga yihaye intego yo gusakaza amakuru yizewe kandi afatika binyuze kuri agezweho.com. Tugamije gufasha buri wese kubona amakuru yu2025ingenzi kandi agendanye nu2025igihe, harimo amazina agezweho hamwe nu2025ibindi byu2025ubumenyi bikenewe.\n\n### Impamvu ukwiye kuduhitamo\n- Amakuru yizewe: Dushyira imbere ukuri nu2025ubunyamwuga mu nkuru zacu.\n- Amakuru mashyashya akakanya: Tumenyesha amakuru yihutirwa akenewe.\n- Kwita ku muryango: Twitaho inyungu zu2025umuryango tubinyujije mu makuru yu2025ubumenyi bwimbitse.\n\n### Twandikire\n- Telefoni: 0789690247\n- Imeli: novarwa@outlook.com\n\nHamwe natwe, mugire ubuzima bujijutse binyuze mu makuru yu2019ukuri kandi agezweho.','2024-12-19 09:58:21','2024-12-19 09:58:21');
